CBRE are pleased to offer 104 Mica Street, Carole Park to the market. This is a rare opportunity to secure a functional premium grade cold storage facility.

Features of the property include:

+ 1,725sqm Cold storage facility; 
+ 7,664sqm Industrial land holding; 
+ Includes Freezer, chiller and ambient area; 
+ Three loading docks plus a loading ramp; 
+ Only 22% site cover offering expansion upside (STCA); 
+ Over 4,000sqm of concrete hardstand areas; 
+ Excellent truck access, external storage and maneuvering area
+ Large 3 phase power supply (transformer onsite); 
+ Fully secured and alarmed site 

Perfectly located in Carole Parks highly sought after Synergy Business Park. The property is only 19 radial kilometres south west of Brisbaneâ€™s CBD and benefits from excellent access to nearby arterial roads including the Ipswich, Logan and  Centenary Motorways. 

For further details or to arrange an inspection please contact Mark Gilbride the Exclusive Agent.

CBRE are pleased to offer 114 Mica Street, Carole Park to the market for sale. This is a rare opportunity to secure a near new tilt panel facility located in the highly sought after Synergy Business Park.

Features of the property include: 

+  1,888sqm Clearspan warehouse; 
+  333sqm Corporate grade office & showroom; 
+  4,491sqm Freehold industrial land;
+  Full concrete tilt panel construction; 
+  4 Container height roller doors; 
+  Minimum internal height of 8.5m; 
+  Amenities are provided to both warehouse and office; 
+  23 carparks provided (3 undercover); 
+  Excellent truck access, external storage and maneuvering area;

Located in the highly sought after Synergy Business Park this brand new facility offers direct access to the Logan, Ipswich and Centenary Motorways.

For further details or to arrange an inspection please contact Mark Gilbride the Exclusive Agent
